class Solution:
    def isValid(self, s: str) -> bool:
        if len(s) == 1: return False
        dicts = {
            ')': '(',
            ']': '[',
            '}': '{'
        }
        saved = ['x']
        for string in s:
            if string in dicts.values():
                saved.append(string)
            else:
                if dicts[string] == saved[-1]:
                    saved.pop()
                else:
                    return False
            # print(saved)
        if len(saved) == 1:
            return True
        return False

test = Solution()

